fun atmTransaction(
    id: Int, accountNumber: Int, year: Int, month: Int, day: Int, atmLocation: String, transactionType: String, amount: Int
): MutableMap<String, Any> {

    return mutableMapOf(
        "id" to id,
        "accountNumber" to accountNumber,
        "year" to year,
        "month" to month,
        "day" to day,
        "atmLocation" to atmLocation,
        "transactionType" to transactionType,
        "amount" to amount,
    )
}

